// src/App.js
import React, { Suspense, lazy } from 'react';
import { BrowserRouter, Routes, Route, useNavigate } from 'react-router-dom';
import './styles/global.css';

// Lazy load components
const UserList = lazy(() => import('./components/UserList'));
const UserDetails = lazy(() => import('./components/UserDetails'));
const RepoList = lazy(() => import('./components/RepoList'));

const App = () => {
  // O useNavigate não pode ser chamado no corpo do componente App diretamente,
  // pois ele deve ser usado dentro de um componente que é renderizado por uma Route.
  // Por isso, criamos um componente interno para isso.
  const RouteHandler = () => {
    const navigate = useNavigate();

    const onSelectUser = (username) => {
      navigate(`/users/${username}/details`);
    };

    return (
      <Suspense fallback={<div>Loading...</div>}>
        <Routes>
          <Route path="/" element={<UserList onSelectUser={onSelectUser} />} />
          <Route path="/users/:username/details" element={<UserDetails />} />
          <Route path="/users/:username/repos" element={<RepoList />} />
        </Routes>
      </Suspense>
    );
  };

  return (
    <BrowserRouter>
      <RouteHandler />
    </BrowserRouter>
  );
};

export default App;
